import React, { Component } from 'react'
import NavBar from './components/NavBar'
import Products from './components/Products'
import ShoppingCart from './components/ShoppingCart'

export default class App extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <Products />
        <ShoppingCart />
      </div>
    )
  }
}
